import Navbar from './Navbar';

const navigation = [
  {
    "nom" : "Accueil",
    "lien" : "/home"
  },
  {
    "nom" : "Emploi du temps",
    "lien" : "/edt"
  },
  {
    "nom" : "Trombinoscope",
    "lien" : "/trombi"
  },

]

function About() {
  return (
    <div>
      <Navbar info={ navigation } />
      <h1 className='text-3xl font-light'>About</h1>
    </div>
  );
}

export default About;
